// import { CgOptions } from "react-icons/cg";




const Nav = ({toggle}) => {
    return (
        <nav className="flex justify-between items-center w-full bg-backgroundcolor  text-block relative shadow-sm font-mono navbar">
            <div className="md:ml-[12px]">
            {/* <IoGrid className="md:w-[2em] md:h-[2em] text-[#f98a8d] "/> */}
            </div>
            <div className="absolute md:left-[10em]"> 
                <h2>DOGIE mall</h2>
            </div>
            <div className="md:mt-2 flex justify-center" >
                <input placeholder="Search for Product" className="text-center text-[#00000] font-bold shadow-lg broder-2 rounded-full md:w-[26em] md:h-[3em] " style={{
                    borderRadius: '10px',
                    outline: 'none',
                }} />
                <span className="text-center  font-bold shadow-lg md:h-[3em] md:w-[3em] absolute inset-y-0 md:left-[48em]" style={{

                    borderTopRightRadius: '10px',
                    borderBottomRightRadius: '10px',
                    outline: 'none',
                    color: "black",
                    background: "#f98a8d",
                }}>
                   {/* <CgOptions style={{
                       color: "white",
                       height: "2em",
                       marginTop: '10px',
                       marginLeft: '10px',
                       width: "2em",
                   }}/> */}
                </span>

                <button className="font-bold h-[3em] w-[5em] text-white absolute inset-y-0 md:left-[52em] "
                style={{

                    borderRadius: '10%',
                    background: "#f98a8d",
                    outline: 'none',


                }}>Search</button>
            </div>

            <div className="flex md:mr-[20px] mr-[20px]">
            <span className="flex justify-center items-center md:mr-[15px]"
                >
                    <span className="text-white flex justify-center text-xs absolute rounded-full md:w-[12px] md:h-[12px] md:top-17px md:mt-[-3px] md:ml-[-3px] bg-marketIcon">3</span>
                    {/* <IoBagSharp 
                    className="md:w-[1.5em] md:h-[1.5em] w-[1.5em] h-[1.5em] text-[#00000]"

                    /> */}
                </span>


                <div className="md:h-[4em] md:w-[4em] h-[4em] w-[4em]">
                 <Image
                 width={50}
                 height={50}
                  src='/images/user.png' 
                  className="rounded-full md:w-16 md:h-16 h-16 w-16"
                   />
                </div>

            </div>

        </nav>
    )
}


export default Nav
